import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const Home = () => <h1>Home Page</h1>;
const Edit = () => <h1>Edit Page</h1>;

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/todo/:id" element={<Edit />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
